       if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1823256","type":"CustomJS"},{"attributes":{"overlay":{"id":"1822842"}},"id":"1822837","type":"BoxZoomTool"},{"attributes":{"coordinates":null,"data_source":{"id":"1822978"},"glyph":{"id":"1822979"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1822981"},"nonselection_glyph":{"id":"1822980"},"view":{"id":"1822983"}},"id":"1822982","type":"GlyphRenderer"},{"attributes":{"line_alpha":{"value":0.2},"x0":{"field":"index"},"x1":{"field":"index"},"y0":{"field":"High"},"y1":{"field":"Low"}},"id":"1823116","type":"Segment"},{"attributes":{},"id":"1822825","type":"LinearScale"},{"attributes":{},"id":"1823075","type":"UndoTool"},{"attributes":{"fill_alpha":{"value":0.2},"fill_color":{"field":"inc","transform":{"id":"1822853"}},"hatch_alpha":{"value":0.2},"hatch_color":{"field":"inc","transform":{"id":"1822853"}},"line_alpha":{"value":0.2},"line_color":{"fie
